import SIDE_IMAGE from '../assets/images/shopping_banner.jpg';
import SOFA_IMAGE from '../assets/images/sofa.jpeg';
import CHAIR_IMAGE from '../assets/images/chair.jpg';
import HALL_IMAGE from '../assets/images/hall.jpg';
import TEA_POY_IMAGE from '../assets/images/teapoy.jpeg';
import SOFASET_TEAPOY_IMAGE from '../assets/images/sofaset_teapoy.jpeg';
import SHOPPING_BACKGROUND_IMAGE from '../assets/images/Shopping.jpeg';
const Assets = {
    SIDE_IMAGE,
    SOFA_IMAGE,
    CHAIR_IMAGE,
    HALL_IMAGE,
    TEA_POY_IMAGE,
    SOFASET_TEAPOY_IMAGE,
    SHOPPING_BACKGROUND_IMAGE
};
export default Assets;
